> Top News Obama focusing on condolences, not gun laws, in Oregon visit Demonstrators watch as President Barack Obama arrives at Roseburg Regional Airport in Roseburg, Ore., Friday, Oct. 9, 2015. More than 200 gun-rights activists protested Obama’s visit on Friday to Oregon to meet with the families of victims of last week’s campus killings. The protesters were angry about Obama’s calls for gun restrictions in the wake of the shooting rampage that killed eight students and a teacher at Umpqua Community College. (AP Photo/Ryan Kang) 
